import './App.css';

function App() {
  return (
    // Esta es la estructura de componentes de App
    <div className="App">

      <TodoCounter />
      <TodoSearch />

      <TodoList >
        <TodoItem />
        <TodoItem />
        <TodoItem />
      </TodoList>

      <CreateTodoButton/>

    </div>
  );
}


function TodoItem(){
  return (
    <li>
        <span>V</span>
        <p>Llorar con la llorona </p>
        <span>X</span>
    </li>
  );

}

function TodoCounter(){
  return (
    <h1>
      Has completado 3 de 5 TODOs
    </h1>
  );

}

export default App;
